import logo from './logo.svg';
import './App.css';
import { createBrowserRouter, Link, Outlet, RouterProvider } from "react-router-dom"
const router = createBrowserRouter(
  [
    {
      path: "/",
      element: <Hello />
    },{
      path:"/world",
      element : <World/>,
      children : [
        {
          path: "contacts",
          element: <Contact />,
        },
      ],

    },
  ]
)
function Contact(){
  return(
    <div>
      <h1>Contact</h1>
      <Link to={"/"}>Go to World</Link>
    </div>
  )
}
function Hello() {
  return (
    <div>
      <h1>Hello</h1>
      <Link to={"/world"}>Go to World</Link>
    </div>
  )

}
function World(){
  return(
    <div>
      <h1>World</h1>
      <Link to ={"/world/contacts"}>Go To Contacts</Link>
      <Outlet></Outlet>
    </div>
  )
}
function App() {
  return (
    <div className="App">
      {/*<header className="App-header">
        <img src={logo} className="App-logo" alt="logo" /> */}
        <RouterProvider router={router} />


    </div>
  );
}

export default App;
